// Footer.jsx
import React from 'react';

function Footer() {
  return (
    <footer>
      <p>Connect with me:</p>
      <ul>
        <li><a href="https://github.com">GitHub</a></li>
        <li><a href="https://linkedin.com">LinkedIn</a></li>
        <li><a href="https://stackoverflow.com">Stack Overflow</a></li>
      </ul>
    </footer>
  );
}

export default Footer;
